//make a react component for a logo

import React from 'react';
import logo from './logo.png';
import './logo.css';
import { Link } from 'react-router-dom';

function Logo() {
    return (
        <div className="logo">
        <img src={logo} alt="logo" />
        <Link to="/">Search</Link>
        <Link to="/upload">Upload</Link>
        </div>
    );
}

export default Logo;
